import React from "react";
import { Link, Outlet } from "react-router-dom";
import "./Category.css"; // Import your CSS file



const Category = ({ userType }) => {
  return (
    <div className="app-container">
    
      <div className="app-grid">
        <Link to="internet" className="app-card">
          <img src={internet} alt="Internet & Networking" className="app-icon" />
          <p className="app-text">Internet & Networking</p>
        </Link>
        <Link to="electrical" className="app-card">
          <img src={electrical} alt="Electrical Services" className="app-icon" />
          <p className="app-text">Electrical Services</p>
        </Link>
        <Link to="programming" className="app-card">
          <img src={programmin}alt="Programming" className="app-icon" />
          <p className="app-text">Programming</p>
        </Link>
        <Link to="beauty" className="app-card">
          <img src={beauty} alt="Tickets" className="app-icon" />
          <p className="app-text">Beauty</p>
        </Link>
        {/* Profile Links without icons */}
        {userType === 'technician' && (
          <Link to="profile" className="app-card profile-card">
            <p className="app-text">My Profile</p>
          </Link>
        )}
        
        {userType === 'client' && (
          <Link to="/clientprofile" className="app-card profile-card">
            <p className="app-text">My Profile</p>
          </Link>
        )}
      </div>
      <Outlet />
    </div>
  );
};

export default Category;
